import './App.css';
import NewBookForm from './components/new_book_form';
import BooksContainer from './containers/books_container'
import { fetchBooks } from './actions/fetch_books'


const App = () => {

  let completed = fetchBooks()

  return (
    completed ? 
    <div className="App">
      <NewBookForm/>
      <BooksContainer/>
    </div>
    :
    null
  );
}

export default App
